import bpy

bl_info = {
    "name": "Rig UI",
	"author": "Bigmacbook",
    "version": (1, 0),
    "blender": (4, 0, 0),
    "location": "View3D > UI > Item Tab",
    "description": "A panel to view/toggle bone collections",
    "category": "Animation",
}

class RIGUI_PT_bone_col(bpy.types.Panel):
    bl_label = 'Rig UI'
    bl_idname = 'PANEL_PT_bone_col'
    bl_space_type = 'VIEW_3D'
    bl_region_type = 'UI'
    bl_category = 'Item'

    @classmethod
    def poll(self, context):
        active = context.active_object
        return (active != None and active.type == 'ARMATURE')


    def draw_panel(self, context):
        layout = self.layout
        active = context.active_object
        armature = active.data
        collections = armature.collections
        
        col = layout.column()
        
        bc = {}
        
        for c in collections:
            name = None
            solo = None
            left = None
            right = None

            if c.name.endswith(".L"):
                name = c.name.removesuffix(".L")
                left = c
            elif c.name.endswith(".R"):
                name = c.name.removesuffix(".R")
                right = c
            else:
                name = c.name
                solo = c
            
            if name not in bc:
                item = {}
                item['solo'] = solo
                item['left'] = left
                item['right'] = right
                bc[name] = item
            else:
                if solo != None:
                    bc[name]['solo'] = solo
                if left != None:
                    bc[name]['left'] = left
                if right != None:
                    bc[name]['right'] = right

        for name in bc:
            solo = bc[name]['solo']
            left = bc[name]['left']
            right = bc[name]['right']

            if solo != None:
                row = col.row(align=True)
                row.prop(solo, 'is_visible', toggle=True, icon='HIDE_OFF' if solo.is_visible else 'HIDE_ON', text=solo.name)

            if left != None or right != None:
                row = col.row(align=True)
                if left != None:
                    row.prop(left, 'is_visible', toggle=True, icon='HIDE_OFF' if left.is_visible else 'HIDE_ON', text=left.name)
                else:
                    row.operator("rigui.dummy_operator", icon='HIDE_ON', text=name+'.L')
                if right != None:
                    row.prop(right, 'is_visible', toggle=True, icon='HIDE_OFF' if right.is_visible else 'HIDE_ON', text=right.name)
                else:
                    row.operator("rigui.dummy_operator", icon='HIDE_ON',  text=name+'.R')



    def draw(self, context):
        self.draw_panel(context)


