#include <stdio.h>

// Function to display elements in the array
void displayElements(int arr[], int size) {
    int i; // Let's iterate through the array
    printf("Elements: ");
    for (i = 0; i < size; i++) {
        printf("%d ", arr[i]); // Printing each element
    }
    printf("\n");
}

// Function to perform bubble sort on the array
// Ascending order 
void bubbleSort(int arr[], int size) {
    int i, j; // Let's use i and j for loop counters
    for (i = 0; i < size - 1; i++) {
        for (j = 0; j < size - i - 1; j++) {
            if (arr[j] > arr[j + 1]) {
                // Swap if the current element is greater than the next
                int temp = arr[j];
                arr[j] = arr[j + 1];
                arr[j + 1] = temp;
            }
        }
    }
}

// Function to perform selection sort on the array
// Descending Order
void selectionSort(int arr[], int size) {
    int i, j; // Let's use i and j for loop counters
    for (i = 0; i < size - 1; i++) {
        int minIndex = i; // Assume the current index has the minimum value
        for (j = i + 1; j < size; j++) {
            if (arr[j] > arr[minIndex]) {
                // Update the minimum index if we find a smaller element
                minIndex = j;
            }
        }
        // Swap the minimum element with the current element
        int temp = arr[i];
        arr[i] = arr[minIndex];
        arr[minIndex] = temp;
    }
}

// Function to perform insertion sort on the array
//Ascending order
void insertionSort(int arr[], int size) {
    int i, j, key; // Let's use i, j, and key for loop counters and the key to store the current element
    for (i = 1; i < size; i++) {
        key = arr[i]; // Store the current element
        j = i - 1;

        // Move elements greater than key to one position ahead
        while (j >= 0 && arr[j] > key) {
            arr[j + 1] = arr[j]; // Shift elements to make space for the key
            j = j - 1;
        }

        arr[j + 1] = key; // Insert the key in its correct position
    }
}

